        login() {
            if(!this.validateForm.userName || !this.validateForm.password){
                this.$message({
                    message: '用户名密码不能为空',
                    showClose: true,
                    type: 'warning'
                });
                return false;
            }
            var data = {
                username:this.validateForm.userName,
                password:this.validateForm.password,
                is_need_token:1
            }
            this.$axios.instance({
                url:'/login',
                method:'post',
                data:Qs.stringify(data)
            })
            .then((res) => {
                if(res.status == 200){
                    this.$message({
                        message: '登陆成功',
                        showClose: true,
                        type: 'success'
                    });
                    window.localStorage.setItem('user',JSON.stringify(res.data))
                    this.$router.push('/')
                   
                }
            })
        },
        goHome() {
            this.$router.push('/')
        }
    },
    watch:{
        active(newValue) {
            if(newValue==0){
